const colors = {
  header: '#333333',
  primary: '#00ffce',
  secondary: '#1f1a30',
  transparent: 'rgba(0, 0, 0, 0)',
  light: '#fff',
  dark: '#000',
  lead: '#1A1A1A',
  transparentHalf: 'rgba(250, 250, 250, 0.3)',
  danger: '#ff4949',
  toast: {
    error: '#ff2e2e',
    success: '#2bb673',
    alert: '#fbd33a',
    info: '#4dbae1'
  }
};

export default colors;
